import React from 'react';
import './App.css';
import Detail from './components/detail.component/detail.component';

import { Route, Switch, BrowserRouter as Router } from "react-router-dom";

function App() {
  return (
    <Router>
      <div>
        <Header />
        <Switch>
          {/* <Route path='/' exact > <DashBoard heroList={heroList} /></Route>
                  <Route path='/herolist' component={() => <HeroList heroList={heroList} />} /> 
                  <Route path='/' component={(props) => <Detail heroList={heroList} {...props} />} />
                  <Route component={PageNotFound} />*/}
          <Route path='/' component={Detail} />
        </Switch>

      </div>
    </Router>
  );
}

export default App;
